      SELECT DISTINCT ( + 10 ) * - + 80 - - - col2, - col1 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NOT col1 NOT BETWEEN - + col2 * 75 / 68 AND NULL;
  - name: tab1

outputs:
